import React, { useState } from "react";
import {
  TextField,
  Button,
  Box,
  Typography,
  Checkbox,
  FormControlLabel,
  Link, // Dùng để tạo link nếu cần
  Stack, // Thư viện MUI để sắp xếp các phần tử dễ dàng
} from "@mui/material";
import { Link as RouterLink } from "react-router-dom"; // Dùng RouterLink để chuyển hướng

const Register = () => {
  // Đổi tên state 'name' thành 'username' để rõ ràng hơn (theo form gốc là ユーザー名)
  const [username, setUsername] = useState(""); // 2. ユーザー名
  const [email, setEmail] = useState(""); // 3. メール
  const [password, setPassword] = useState(""); // 4. パスワード
  const [confirmPassword, setConfirmPassword] = useState(""); // 5. パスワードをもう一度入力してください
  const [agreedToTerms, setAgreedToTerms] = useState(false); // 6. ユーザー権利に同意する (Đổi tên state cho rõ ràng)

  const handleSubmit = async (e) => {
    e.preventDefault();

    // Logic kiểm tra mật khẩu khớp nhau
    if (password !== confirmPassword) {
      alert("パスワードが一致しません (Mật khẩu không khớp)!");
      return;
    }
    // Logic kiểm tra đồng ý điều khoản
    if (!agreedToTerms) {
      alert("ユーザー権利に同意してください (Vui lòng đồng ý với điều khoản).");
      return;
    }

    try {
      console.log({ username, email, password });
      // TODO: Logic gọi API đăng ký (registerAction) ở đây
      alert("Đăng ký thành công (Mô phỏng). Chuyển hướng đến trang Đăng nhập.");
      // Giả lập chuyển hướng sau khi đăng ký thành công
      // navigate("/login"); // Nếu sử dụng useNavigate
    } catch (error) {
      console.error("Registration error:", error);
      alert("登録に失敗しました (Đăng ký thất bại).");
    }
  };

  return (
    <Box
      sx={{
        maxWidth: 400,
        margin: "auto",
        mt: 10,
        padding: 3,
        boxShadow: 3,
        borderRadius: 2,
        backgroundColor: "white",
      }}
    >
      {/* 1. LOGO Placeholder (Theo thiết kế gốc) */}
      <Box
        sx={{
          border: "1px solid #ccc",
          width: 80,
          height: 30,
          margin: "0 auto 30px",
          display: "flex",
          alignItems: "center",
          justifyContent: "center",
        }}
      >
        <Typography variant="body2">LOGO</Typography>
      </Box>

      {/* Tiêu đề ẩn, vì thiết kế gốc chỉ có Logo */}
      {/* <Typography variant="h5" align="center" mb={3}>アカウント作成</Typography> */}

      <form onSubmit={handleSubmit}>
        {/* 2. ユーザー名 (Username) */}
        <TextField
          label="ユーザー名"
          variant="outlined"
          fullWidth
          margin="normal"
          value={username}
          onChange={(e) => setUsername(e.target.value)}
          required
        />
        {/* 3. メール (Email) */}
        <TextField
          label="メール"
          variant="outlined"
          fullWidth
          margin="normal"
          type="email"
          value={email}
          onChange={(e) => setEmail(e.target.value)}
          required
        />
        {/* 4. パスワード (Password) */}
        <TextField
          label="パスワード"
          type="password"
          variant="outlined"
          fullWidth
          margin="normal"
          value={password}
          onChange={(e) => setPassword(e.target.value)}
          required
        />
        {/* 5. パスワードをもう一度入力してください (Confirm Password) */}
        <TextField
          label="パスワードをもう一度入力してください"
          type="password"
          variant="outlined"
          fullWidth
          margin="normal"
          value={confirmPassword}
          onChange={(e) => setConfirmPassword(e.target.value)}
          required
          // Hiển thị lỗi ngay lập tức nếu mật khẩu không khớp
          error={password !== confirmPassword && confirmPassword.length > 0}
          helperText={
            password !== confirmPassword && confirmPassword.length > 0
              ? "パスワードが一致しません"
              : ""
          }
        />

        {/* 6. Checkbox Điều khoản (ユーザー権利に同意する) */}
        <FormControlLabel
          control={
            <Checkbox
              checked={agreedToTerms}
              onChange={(e) => setAgreedToTerms(e.target.checked)}
              name="agreeTerms"
              color="primary"
            />
          }
          label={
            // Dùng Link MUI để tạo liên kết cho "ユーザー権利"
            <Typography variant="body2">
              <Link href="#" color="primary" underline="hover">
                ユーザー権利
              </Link>
              に同意する
            </Typography>
          }
          sx={{ mt: 1, mb: 3, justifyContent: "flex-start", width: "100%" }}
        />

        {/* 7 & 8. Các nút hành động (Dùng Stack để bố cục ngang) */}
        <Stack direction="row" spacing={2} sx={{ mt: 2 }}>
          {/* 7. Nút Đăng ký (アカウントを作成する) - Primary */}
          <Button
            type="submit"
            variant="contained"
            color="primary"
            disabled={!agreedToTerms} // Vô hiệu hóa nếu chưa đồng ý điều khoản
            sx={{ flexGrow: 1 }} // Chiếm hết phần không gian còn lại
          >
            アカウントを作成する
          </Button>

          {/* 8. Nút Đăng nhập (ログイン) - Secondary */}
          <Button
            component={RouterLink} // Sử dụng RouterLink để chuyển hướng
            to="/login" // Thay đổi đường dẫn thực tế của bạn
            variant="outlined"
            color="secondary"
            sx={{ minWidth: 100 }} // Đặt kích thước nhỏ hơn nút chính
          >
            ログイン
          </Button>
        </Stack>
      </form>
    </Box>
  );
};

export default Register;
